import './App.css';
import { Routes, Route, useParams } from "react-router-dom";
import { useState } from 'react';
import HomePage from './HomePage/HomePage';
import ArticlesPage from './ArticlesPage/ArticlesPage';
import Category from './Category/Category'
import RegistrePage from './Registre/RegistrePage';
import Session from './Session';
import Logo from './HomePage/Logo';
import Search from './HomePage/Search';
import SearchCategory from './SearchCategory';


function App() {
  const [search, setSearch] = useState('')
  const [show, setShow] = useState(false)
  const [user, setUser] = useState('')
  const { category } = useParams()
  return (
    <div>
      <header className="header">
      <Logo />
      <Routes>
        <Route path='/' element={<Search setSearch={setSearch}/>} />
        <Route path='/article/byCategory/:category' element={<SearchCategory setSearch={setSearch} category={category}/>} />
      </Routes>
      <Session show={show} setShow={setShow} />
    </header>
      <Routes>
        <Route path="/" element={<HomePage search={search} setSearch={setSearch}  setUser={setUser} user={user}/>} />
        <Route path="article/:id" element={<ArticlesPage />} />
        <Route path="article/byCategory/:category" element={<Category search={search} setSearch={setSearch}  setUser={setUser} user={user}/>} />
        <Route path="user/registre" element={<RegistrePage />} />
      </Routes>
    </div>
  );
}

export default App;
